import { Mutation } from 'react-apollo'
import gql from 'graphql-tag'
import Form from './styles/Form'
import Error from './styles/Error'

class SignUp extends Component {
  render() {
    return (
      <div>
        <Form>
          <fieldset>
            <h2>Sign up for an Account!</h2>
          </fieldset>
        </Form>
      </div>
    );
  }
}

export default SignUp;
